import { useState } from "react";
import { db } from "../config/firebase";

import { useNavigate } from "react-router-dom";
import { setDoc, doc } from "firebase/firestore";

export default function AddPerson() {
  const [person, setPerson] = useState({
    email: "",
    name: "",
    age: "",
    gender: "",
    level_on_the_spectrum: "",
    caregiver_details: { phone_no: "", name: "", age: "", gender: "", relation: "" },
    medical_history: { date_of_diagnosis: "", prescriptions: [] },
    medical_professional_details: { phone_no: "", name: "", specialty: "", availability_time: "", hospital: "" },
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setPerson((prev) => ({ ...prev, [name]: value }));
  };

  const handleNestedChange = (category, field, value) => {
    setPerson((prev) => ({
      ...prev,
      [category]: { ...prev[category], [field]: value },
    }));
  };

  const handleSave = async () => {
    try {
      const docRef = doc(db, "Person", person.email);
      await setDoc(docRef, person);
      alert("Details added successfully");
    } catch (error) {
      console.error("Error adding document:", error.message);
    }
  };

  return (
    <div>
      <h2>Add Person</h2>
      <input
        type="email"
        name="email"
        placeholder="Email"
        value={person.email}
        onChange={handleChange}
      />
      <input
        type="text"
        name="name"
        placeholder="Name"
        value={person.name}
        onChange={handleChange}
      />
      <input
        type="number"
        name="age"
        placeholder="Age"
        value={person.age}
        onChange={handleChange}
      />
      <input
        type="text"
        name="gender"
        placeholder="Gender"
        value={person.gender}
        onChange={handleChange}
      />
      <input
        type="number"
        name="level_on_the_spectrum"
        placeholder="Level"
        value={person.level_on_the_spectrum}
        onChange={handleChange}
      />

<h2>Add caregiver Details</h2>
      <input
        type="number"
        name="phone_no"
        placeholder="PhoneNo"
        value={person.caregiver_details.phone_no}
        onChange={handleNestedChange}
      />
      <input
        type="text"
        name="name"
        placeholder="Name"
        value={person.caregiver_details.name}
        onChange={handleChange}
      />
      <input
        type="number"
        name="age"
        placeholder="Age"
        value={person.caregiver_details.age}
        onChange={handleChange}
      />
      <input
        type="text"
        name="gender"
        placeholder="Gender"
        value={person.caregiver_details.gender}
        onChange={handleChange}
      />
      <input
        type="text"
        name="relation"
        placeholder="Relation"
        value={person.caregiver_details.relation}
        onChange={handleChange}
      />

<h2>Add Medical History</h2>
      <input
        type="datetime-local"
        name="date_of_diagnosis"
        placeholder="DateOfDiagnosis"
        value={person.medical_history.date_of_diagnosis}
        onChange={handleNestedChange}
      />
      <input
        type="array"
        name="prescriptions"
        placeholder="Prescriptions"
        value={person.medical_history.prescriptions}
        onChange={handleChange}
      />

<h2>Add Medical Professionals History</h2>
      <input
        type="number"
        name="phone_no"
        placeholder="PhoneNo"
        value={person.caregiver_details.phone_no}
        onChange={handleChange}
      />
      <input
        type="text"
        name="name"
        placeholder="Name"
        value={person.caregiver_details.name}
        onChange={handleChange}
      />
      <input
        type="datetime-local"
        name="AvailabilityTime"
        placeholder="AvailabilityTime"
        value={person.medical_professional_details.Availability_Time}
        onChange={handleChange}
      />
      <input
        type="text"
        name="speciality"
        placeholder="Speciality"
        value={person.medical_professional_details.specialty}
        onChange={handleChange}
      />
      <input
        type="text"
        name="hospital" 
        placeholder="Hospital"
        value={person.medical_professional_details.hospital}
        onChange={handleChange}
      />
      <button onClick={handleSave}>Save</button>
    </div>
  );
}
